INSERT INTO `about_us` VALUES (1, 'Astraea Leather Craft', 'We are an MSME (Micro, Small, and Medium Enterprise) engaged in the field of handicrafts. Our products include bags, wallets, and merchandise made fromc owhide leather.\r\n\r\nWe have an offline store located on Dr. Wahidin Sudiro Husodo Street, Manding, Sabdodadi, Bantul, which we use as a showroom to display our creations. Manding is the largest leather craft center in Yogyakarta, where local artisans have gathered for decades.\r\n\r\nHow can we ensure the quality of our products? Our production process goes beyond just stitching; it starts with the tanning process. With over 20 years of experience in the field, we have honed our expertise to deliver exceptional craftsmanship. \r\n\r\nEvery product we create is a testament to our dedication and commitment to excellence. We meticulously oversee each stage of production, from selecting the finest materials to employing skilled artisans. Our extensive experience and attention to detail ensure that every item we produce is of the highest quality.\r\n\r\nOur production team consists ofexperienced and skilled artisans capableof creating a diverse range of productswith exceptional craftsmanship.', 'images/ro14RNuuEdcFjQUP36OWTAjfmgxfi596o3mDuEbr.png', 'developer', 'USR-20240531190525134686', NULL, '2024-06-17 12:44:42');
